import React from 'react'
import FadeIn from 'react-fade-in/lib/FadeIn';

export default function Banner() {
    return (
        <div className='banner'>
            <div className='greeting'>
                <FadeIn delay={500}>
                    <h1>Parkside</h1>
                    <h2>Cafe and Sushi</h2>
                </FadeIn>
            </div>
        </div>
    )
}
